    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-20T03:21:02.540561",nt"name": "seismic-reflection-profile-tracklines-that-are-located-adjacent-to-vibracores-collect-2005-2007",nt"isopen":
    false,nt"url": null,nt"notes": "In 2007, the U.S. Geological Survey collected
    24 vibracores within Apalachicola Bay, Florida. The vibracores were collected using
    a Rossfelder electric percussive (P-3) vibracore system during a cruise on the R/V
    Gilbert. Selection of the core sites was based on a geophysical survey that was
    conducted during 2005 and 2006 in collaboration with the National Oceanic and Atmospheric
    Administrationu00e2u0080u0099s (NOAA) Coastal Services Center (CSC) and the Apalachicola
    Bay National Estuarine Research Reserve. Available data include the vibracore data
    logs and photographs, select seismic-reflection profiles (from the geophysical survey),
    and core-derived data including: grain size analyses, radiocarbon ages, microfossil
    counts, and sedimentological interpretations. The long-term goal of this study is
    to provide maps, data, and assistance to the Apalachicola Bay National Estuarine
    Research Reserve in their effort to monitor and understand the geology and ecology
    of Apalachicola Bay Estuary. These data will inform coastal managers charged with
    resource preservation.",nt"license_title": null,nt"extras": [{ntt"key":
